	public static int maxDiff(int[] arr, int N) {

		int max = 0;
		for(int i=1; i< arr.length -1; i++) {

			int left =0;
			int right =0;

			for(int j=0; j<i; j++) {
				if(arr[j] > arr[i]) {
					left++;
				}
			}

			for(int j=i+1; j<arr.length; j++) {
				if(arr[j] < arr[i]) {
					right++;
				}
			}

			if(max < Math.abs(right - left))
				max = Math.abs(right - left);

		}



		return max;
	}
	
	public static int maxDiffRec(int[] arr, int N) {
		
		int max = 0;
		for(int i=1; i< arr.length -1; i++) {
			int counter = 0;
			int left = maxRec(arr, i, counter);
			int right = maxRecRight(arr, i, counter);
			int value = Math.abs(right-left);
			if(max < value) 
				max = value;
		}
		
		return max;


	}
	
	public static int maxRec(int[] arr, int i, int counter) {
		
		if(i>0) {
			if(arr[i-1] > arr[i])
				counter++;
			
			counter = maxRec(arr, i-1, counter);		
			
		}
		
		return counter;		
		
	}
	
	public static int maxRecRight(int[] arr, int i, int counter) {
		
		if(i<arr.length - 1) {
			if(arr[i+1] < arr[i])
				counter++;
			
			counter = maxRecRight(arr, i+1, counter);		
			
		}
		
		return counter;		
		
	}
	
	public static int maxDiffStreams(int[] arr, int N) {

		int max = 0;
		for(int i=1; i< arr.length -1; i++) {

			int left =0;
			int right =0;

			for(int j=0; j<i; j++) {
				if(arr[j] > arr[i]) {
					left++;
				}
			}

			for(int j=i+1; j<arr.length; j++) {
				if(arr[j] < arr[i]) {
					right++;
				}
			}

			if(max < Math.abs(right - left))
				max = Math.abs(right - left);

		}



		return max;
	}
	
	
